DA/SA with manual safety;
Front slide serrations;
Three 16-round (9mm) 
Ambidextrous decocking/manual safety levers;
Reversible magazine release;
External hammer;
Stainless Steel barrel;
Stainless Steel slide;

Additional features include a  full-length guide rod, three-dot fixed sights, ergonomic, checkered polymer frame with interchangeable backstraps and integrated accessory rail and a lockable, fitted hard case.

 This version also features the manual safety option. The safety may be applied while the hammer is cocked.

Looking to trade for Springfield XDS 45 or Glock 36 OD Green, 19 OD Green, 26 OD Green. 

Want to keep it a local transaction. Must sign BOS/trade.
